import React from 'react';

import "./navbar.css"; 

import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <div>
                cd
            </div>
            <div>
                <Link to="/log-in" />
            </div>
        </nav>
    )
}

export default Navbar;
